import React from 'react';
import { Link } from 'react-router-dom';
import './animations.css'; // Make sure to import the CSS file

interface Post {
  id: string;
  title: string;
  url: string;
  votes: number;
}

interface PostListProps {
  posts: Post[];
}

const PostList: React.FC<PostListProps> = ({ posts }) => {
  return (
	<ul className="post-list">
	  {posts.map((post, index) => (
		<li key={post.id} className={`category-item fade-in`} style={{animationDelay: `${index * 0.1}s`}}>
		  <Link to={post.url} target="_blank" rel="noopener noreferrer">
			{post.title}
		  </Link>
		  <span className="count">{post.votes} votes</span>
		</li>
	  ))}
	</ul>
  );
};

export default PostList;
